{"python.json":"{
	// Place your snippets for python here. Each snippet is defined under a snippet name and has a prefix, body and 
	// description. The prefix is what is used to trigger the snippet and the body will be expanded and inserted. Possible variables are:
	// $1, $2 for tab stops, $0 for the final cursor position, and ${1:label}, ${2:another} for placeholders. Placeholders with the 
	// same ids are connected.
	// Example:
	// "Print to console": {
	// 	"prefix": "log",
	// 	"body": [
	// 		"console.log('$1');",
	// 		"$2"
	// 	],
	// 	"description": "Log output to console"
	// }
}","dart.json":"{
	"Initialize Dio": {
		"prefix": "dio",
		"body": [
			"final _dio = Dio();",
		],
		"description": "initialize Dio"
	},
	"Magic number": {
		"prefix": "magicNumber",
		"body": "static const $1 = $2;",
		"description": "Hwa Magic Number Create"
	  },
	  "Singleton Eager": {
		"prefix": "Eager",
		"body": [
		  "class $1 {",
		  	"static $1 _instace;",
		  	"static $1 get instance {",
		  		"_instace ??= $1._init();",
		  		"return _instace;",
		  	"}",
		  	"$1._init();",
		  "}"
		],
		"description": "Hwa Eager Class Create"
	  },
	  "Base Model ": {
		"prefix": "baseModel",
		"body": [
			"import 'package:json_annotation/json_annotation.dart';",
			"part '$1.g.dart';",
			"",
			"@JsonSerializable()",
			"class $2 {",

			  "factory $2.fromJson(Map<String, Object> json) {",
			    "return _$$2FromJson(json);",
			  "}",

			  "Map<String, Object> toJson() {",
			    "return _$$2ToJson(this);",
			  "}",
			"}",
		]
	  },
	  "Debug Print":{
		  "prefix": "dep",
		  "body": "debugPrint($1);",
		  "description": "Debug Print"
	  }
}"}
